function download(f){
  let data, ext, type;
  if(f==='gpx'){data=togpx(g);ext='gpx';type='application/gpx+xml';}
  if(f==='kml'){data=tokml(g);ext='kml';type='application/vnd.google-earth.kml+xml';}
  if(f==='geojson'){data=JSON.stringify(g,null,2);ext='geojson';type='application/geo+json';}
  const a=document.createElement('a');
  a.href=URL.createObjectURL(new Blob([data],{type}));
  a.download='trace-Rolleville-0.00km-2025-12-05.'+ext;
  a.click();
}

function share(){
  const blob = new Blob([document.documentElement.outerHTML], {type: 'text/html'});
  const file = new File([blob], 'trace-Rolleville-0.00km-2025-12-05.html', {type: 'text/html'});

}

async function exportPDF(){
  const btn = event.target;
  btn.textContent = '‚è≥ G√©n√©ration...';
  btn.disabled = true;
  
  try{
    if (typeof window.jspdf === 'undefined') {
      throw new Error('jsPDF non charg√©');
    }
    
    // Attendre que toutes les tuiles soient charg√©es
    await new Promise(resolve => {
      let tilesLoading = 0;
      map.eachLayer(layer => {
        if (layer._tiles) {
          Object.keys(layer._tiles).forEach(key => {
            const tile = layer._tiles[key];
            if (!tile.complete) {
              tilesLoading++;
              tile.onload = () => {
                tilesLoading--;
                if (tilesLoading === 0) resolve();
              };
            }
          });
        }
      });
      if (tilesLoading === 0) resolve();
      // Timeout de s√©curit√© apr√®s 5 secondes
      setTimeout(resolve, 5000);
    });
    
    // Petite pause suppl√©mentaire pour √™tre s√ªr
    await new Promise(resolve => setTimeout(resolve, 500));
    
    const canvas = await html2canvas(document.body, {
      useCORS: true,
      allowTaint: false,
      logging: false,
      scale: 2,
      backgroundColor: '#ffffff'
    });
    
    const imgData = canvas.toDataURL('image/jpeg', 0.95);
    const { jsPDF } = window.jspdf;
    
    const orientation = canvas.width > canvas.height ? 'l' : 'p';
    const pdf = new jsPDF({
      orientation: orientation,
      unit: 'mm',
      format: 'a4'
    });
    
    const pageWidth = pdf.internal.pageSize.getWidth();
    const pageHeight = pdf.internal.pageSize.getHeight();
    const imgWidth = pageWidth;
    const imgHeight = (canvas.height * pageWidth) / canvas.width;
    
    let finalWidth = imgWidth;
    let finalHeight = imgHeight;
    if (imgHeight > pageHeight) {
      finalHeight = pageHeight;
      finalWidth = (canvas.width * pageHeight) / canvas.height;
    }
    
    pdf.addImage(imgData, 'JPEG', 0, 0, finalWidth, finalHeight);
    pdf.save('trace-Rolleville-0.00km-2025-12-05.pdf');
    
    btn.textContent = '‚úÖ PDF cr√©√©';
    setTimeout(() => {
      btn.textContent = 'üìÑ PDF';
    }, 2000);
  } catch(err){
    console.error('Erreur PDF:', err);
    try {
      const canvas = await html2canvas(document.body, {
        useCORS: true,
        allowTaint: false,
        logging: false,
        scale: 2
      });
      const imgData = canvas.toDataURL('image/png');
      const link = document.createElement('a');
      link.download = 'trace-Rolleville-0.00km-2025-12-05.png';
      link.href = imgData;
      link.click();
      alert('Export PDF non disponible, image PNG g√©n√©r√©e √† la place.');
    } catch(err2) {
      alert('Erreur lors de la g√©n√©ration: ' + err2.message);
    }
    btn.textContent = 'üìÑ PDF';
  } finally{
    btn.disabled = false;
  }
}
